import AudioPlayer from "react-h5-audio-player";

function Index() {
  return (
    <body>
      <img src="static/images/banner.png" alt="The Artefact" />
      const Player = () => (
        <AudioPlayer
          autoPlay
          src="static/audio/005_day.mp3"
          onPlay={e => console.log("onPlay")}
          // other props here
        />
      );
      <style jsx>{`
        ul {
          padding: 0;
        }
      `}</style>
    </body>
  );
}

export default Index;
